(7, , 'Meteorito Cape York', 'Choose', 'Savissivik, Groenlandia', '582 toneladas.', 'sdsaf'),
(8, , 'Meteorito de Hoba', 'Metálico', 'Grootfontein, región de Otjozondjupa (Namibia), donde fue descubierto en 1920.', '60 toneladas', 'Namibia, Sudáfrica. Fue declarado Monumento Nacional en 1955. Este es el meteorito más grande que se ha encontrado de una pieza, y el mayor trozo de hierro de origen natural que se haya descubierto sobre la faz de la Tierra. El Hoba pesa 60 toneladas y mide unos tres metros de ancho por tres metros de largo, con una profundidad de tres pies.'),
(9, , 'Meteorito El Chaco', 'Hierro', 'Campo del Cielo, Gancedo, Provincia del Chaco', '30 800 kg', 'Este aterrizó en el noreste de Argentina. El meteorito El Chaco es uno de los muchos fragmentos que conforman el Campo del Cielo, una acumulación de meteoritos de hierro. Aunque pese más de 37 toneladas, no es sólo el mayor fragmento de este grupo, pero es el segundo meteorito de una sola pieza en el ranking mundial.');

