INSERT INTO `prediccion` (`id`, `newMeteorito`, `tipo`, `fechaAprox`, `orbita`, `info`) VALUES
(1, '1998 OR2', 'Asteroide', '2057-09-02 00:00:00', '8 millones de kilómetros de la órbita de la Tierra', 'Ese honor pertenece al asteroide 3122 Florence (1981 ET3), que pasó volando y por suerte no chocó con la Tierra el 1 de septiembre de 2017. Pasará nuevamente el 2 de septiembre de 2057. Se estima que ese asteroide tenga entre 3 a 9 kilómetros de ancho.'),
(4, 'El asteroide Bennu', 'Asteroide', '2035-01-01 00:00:00', '300,000 kilómetros de nuestro planeta.', 'Bennu es considerado potencialmente peligroso para nosotros por su cercanía y tamaño. Es por esta razón desean conocer con más exactitud su trayectoria. Ya que, se estima que podría pasar cerca de la Tierra en el año de 2035.'),
(5, 'El asteroide Apofis', 'Asteroide', '2029-04-13 00:00:00', '35.000 kilómetros de la Tierra', 'El asteroide descubierto en 2004 (considerado uno de los más peligrosos para la civilización), que los científicos bautizaron como “Apofis” pasará, en principio, rozando nuestro planeta el próximo viernes 13 de abril de 2029. Según los nuevos cálculos de los astrónomos, la roca espacial tiene una anchura de tres campos de fútbol y una masa de más de 46 millones de toneladas'),
(6, 'El asteroide AG5', 'Choose', '2040-02-05 00:00:00', '---', 'Los científicos vigilan de cerca a un enorme asteroide que puede suponer una amenaza para la Tierra en cuestión de unas pocas décadas. La roca espacial, llamada 2011 AG5, mide 140 metros de diámetro y es posible que se acerque demasiado a nuestro planeta en el año 2040, lo suficiente como para que algunos investigadores comiencen a plantearse cómo desviarla, según informa');

