(35, , 'NO-44 (PCSat - Navy OSCAR 44)', 'ninguna', 'ninguna', '----', '0000-00-00 00:00:00', 'SEMI-OPERATIVO', '790 x 797 km con 67 grados de inclinación', 'Fue construido en la Academia Naval de Estados Unidos.', 'OSCAR 44 (también llamado Navy-OSCAR 44 , PCSat-1 , Prototype Communications SATellite y NO-44 ) es un satélite de radio aficionado estadounidense para radio por paquetes. Fue construido en la Academia Naval de Estados Unidos . El satélite fue lanzado el 30 de septiembre de 2001 por el Kodiak Launch Complex , Alaska , utilizando un cohete Athena 1'),
(36, , 'UBAKUSAT', 'Satelite Transportador Lineal', 'ninguna', '2 años', '2018-04-11 00:00:00', 'Falleció el 11 de julio de 2020', '400 km x 400 km', 'Laboratorio de pruebas y diseño de sistemas espaciales de la UIT', 'Se lanzó al espacio a bordo de un cohete Falcon-9 en abril de 2018 y se desplegó en su órbita desde la Estación Espacial Internacional en mayo de 2018. Fue construido como un satélite de observación de la Tierra y demostración de tecnología para proporcionar comunicaciones de voz para estaciones de radioaficionados alrededor el mundo.'),
